import React from 'react';

const UserDashboard = () => {
  return (
    <div>
      <h2>Panel de Usuario</h2>
      {/* Mostrar opciones del panel de usuario */}
      <ul>
        <li>Propiedades Favoritas</li>
        <li>Ofertas Realizadas</li>
        <li>Vender Propiedad</li>
        <li>Rentar Propiedad</li>
      </ul>
    </div>
  );
};

export default UserDashboard;
